import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { loginWithGoogle } from '../services/authService';
import '../styles/LoginPage.css';
import { FcGoogle } from 'react-icons/fc';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [oauthStatus, setOauthStatus] = useState('');
  const { user, handleLogin, login } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    // Check if user is already logged in
    if (user) {
      const redirectTo = location.state?.from || '/';
      navigate(redirectTo);
    }

    // Check for token in URL (for OAuth redirect)
    const searchParams = new URLSearchParams(location.search);
    const token = searchParams.get('token');
    if (token) {
      handleLogin(token);
      navigate('/');
    } else if (searchParams.get('error')) {
      setOauthStatus('OAuth Error: Login failed');
      setError('Login failed');
    }
  }, [user, navigate, location, handleLogin]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      await login(email, password);
      navigate('/');
    } catch (err) {
      setError(err.message || 'Failed to login');
    } finally {
      setLoading(false);
    }
  };

  const handleGoogleLogin = () => {
    setOauthStatus('Initiating Google OAuth flow...');
    loginWithGoogle();
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <h1>Welcome Back</h1>
        <p className="subtitle">Sign in to your Thrift Store account</p>
        
        {error && <div className="error-message">{error}</div>}
        {oauthStatus && <div className="oauth-status">{oauthStatus}</div>}
        
        <form onSubmit={handleSubmit} className="login-form">
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          
          <button type="submit" className="login-button" disabled={loading}>
            {loading ? 'Signing in...' : 'Sign In'}
          </button>
        </form>
        
        <div className="divider">or</div>
        
        <div className="social-login">
          <button 
            className="google-btn" 
            onClick={handleGoogleLogin}
            disabled={loading}
          >
            <FcGoogle size={24} />
            Continue with Google
          </button>
        </div>
        
        <p className="register-link">
          Don't have an account? <Link to="/register">Sign up</Link>
        </p>
        
        <p className="terms">
          By signing in, you agree to our <Link to="/terms">Terms of Service</Link> and <Link to="/privacy">Privacy Policy</Link>
        </p>
      </div>
    </div>
  );
};

export default LoginPage;
